n//Throw error on invalid input types.\r\n.#{$pretty--class-name} input:not([type='checkbox']):not([type='radio']) {\r\n  display: none;\r\n\r\n  @if $pretty--debug {\r\n    + *:after {\r\n      content: $pretty--err-message;\r\n      border: 1px solid #dedede;\r\n      border-left: 3px solid #d9534f;\r\n      padding: 9px;\r\n      font-size: 1em;\r\n      font-weight: 600;\r\n      color: #d9534f;\r\n      position: absolute;\r\n      z-index: 3;\r\n      background: #fbfbfb;\r\n      top: 0;\r\n      left: 0;\r\n    }\r\n  }\r\n}\r\n\r\n.#{$pretty--class-name} {\r\n  position: relative;\r\n  display: inline-block;\r\n  margin-right: 1em;\r\n  white-space: nowrap;\r\n  line-height: 1;\r\n\r\n  input {\r\n    position: absolute;\r\n    left: 0;\r\n    top: 0;\r\n    min-width: 1em;\r\n    width: 100%;\r\n    height: 100%;\r\n    z-index: $pretty--z-index-front;\r\n    opacity: 0;\r\n    margin: 0;\r\n    padding: 0;\r\n    cursor: pointer;\r\n  }\r\n\r\n  .state {\r\n    label {\r\n      position: initial;\r\n      display: inline-block;\r\n      font-weight: normal;\r\n      margin: 0;\r\n      text-indent: $pretty--label-text-offset;\r\n      min-width: $pretty--box-size;\r\n\r\n      &:before,\r\n      &:after {\r\n        content: '';\r\n        width: $pretty--box-size;\r\n        height: $pretty--box-size;\r\n        display: block;\r\n        box-sizing: border-box;\r\n        border-radius: 0;\r\n        border: 1px solid transparent;\r\n        z-index: $pretty--z-index-back;\r\n        position: absolute;\r\n        left: 0;\r\n        top: $pretty-top-offset;\r\n        background-color: transparent;\r\n      }\r\n\r\n      &:before {\r\n        border-color: $pretty--color-default;\r\n      }\r\n    }\r\n\r\n    &.p-is-hover,\r\n    &.p-is-indeterminate {\r\n      display: none;\r\n    }\r\n  }\r\n}","$pretty--class-name: pretty !default;\r\n\r\n// colors\r\n$pretty--color-default: #bdc3c7 !default;\r\n$pretty--color-primary: #428bca !default;\r\n$prett